import { Col, Row } from 'antd'
import React, { Component } from 'react'
import Footer from '../footer/Footer'
import Header from '../header/Header'

export default class MailDetail extends Component {
    render() {
        return (
            <div>
                <Header />
                <Row>
                    <Col></Col>
                </Row>
                <Footer />
            </div>
        )
    }
}
